import { useNavigate } from 'react-router-dom'

const Home = () => {
    let navigate = useNavigate();
    function push() {
        navigate("/productcategories");
    }
    return (
        <>
            <h1>Home Page</h1>
            <div>
                <button onClick={push}>Categories page</button>
                <button>User Dashboard</button>
            </div>
        </>
    )
}

export default Home
